import React, { Fragment, useState } from 'react'
import styled from '@emotion/styled';

import { useNavigate } from 'react-router-dom';
import { useDispatch } from 'react-redux';

import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import ShoppingCartOutlinedIcon from '@mui/icons-material/ShoppingCartOutlined';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';


import { Backdrop, SpeedDial, SpeedDialIcon, SpeedDialAction } from '@mui/material';
// import SpeedDial from '@mui/material/SpeedDial';
// import SpeedDialIcon from '@mui/material/SpeedDialIcon';
// import SpeedDialAction from '@mui/material/SpeedDialAction';


const StyledSpeedDial = styled(SpeedDial)`
  position: fixed;
  top:8px;
  right:30px;
`


const actions = [
  { icon: <ShoppingCartOutlinedIcon />, name: 'Cart' },
  { icon: <AccountCircleIcon />, name: 'Profile' },
  { icon: <ExitToAppIcon />, name: 'Logout' },
];


const Account = ({currentUser}) => {

  const [open, setOpen] = useState(false)

  return (
      <Fragment>
        <StyledSpeedDial
          ariaLabel='SpeedDial controlled open exampl'
          onClose={()=>setOpen(false)}
          onOpen={()=>setOpen(true)}
          open={open}
          icon={<SpeedDialIcon />}
          direction="down"
        >
          {actions.map((action) => (
            <SpeedDialAction
              key={action.name}
              icon={action.icon}
              tooltipTitle={action.name}
              // onClick={handleClose}
            />
          ))}
        </StyledSpeedDial>
      </Fragment>
  );
}

export default Account
